import './App.css';
import { Button ,Navbar,NavbarBrand,NavbarToggler,Collapse,Nav} from 'reactstrap';
import 'antd/dist/antd.css';
import { Carousel } from 'antd';
const contentStyle = {
  height: '360px',
  color: '#fff',
  width:'700px',
  lineHeight: '160px',
  textAlign: 'center',
  background: '#364d79',
};

function App() {
  return (
    <div className="App">
      <div>
  <Navbar
    color="light"
    expand="md"
    light
  >
    <NavbarBrand href="/">
    <h2>Gugu Books</h2>
    </NavbarBrand>

  </Navbar>
</div>
<Carousel autoplay>
    <div>
      <img style={contentStyle} src='https://media-cldnry.s-nbcnews.com/image/upload/newscms/2020_28/3395663/amazon-kindle-ereaders-kr-2x1-tease-200709.jpg'></img>
    </div>
    <div>
      <h3 style={contentStyle}>2</h3>
    </div>
    <div>
      <h3 style={contentStyle}>3</h3>
    </div>
    <div>
      <h3 style={contentStyle}>4</h3>
    </div>
  </Carousel>
    </div>
  );
}

export default App;
